import React from "react";

const Changeheading = (props) => {
  const input = {
    display: "block",
    textAlign: "left",
  };
  return (
    <div>
      <input type="text" onChange={props.changed} placeholder="Update Name" />
    </div>
  );
};

export default Changeheading;
